тАЬрдкрд┐рддреГрд╣рд░реБрд▓реЗ рднрдиреЗ рдХрд┐ рдЫреЛрд░рд╛ рд░реБрдЪреА! рд╣рд╛рдореНрд░реЛ рд╢реНрд░рд╛рджреНрдз рдирд┐рдХрд╛рд▓, рд╣рд╛рдореА рджреБрдГрдЦреА рднрдЗрд░рд╣реЗрдХрд╛ рдЫреМрдВредтАЬ рд░реБрдЪреА рдЛрд╖рд┐рд▓реЗ рдЬрд╡рд╛рдл рджрд┐рдП рдХрд┐ рдкрд┐рддреГрдорд╣реЛ рд╡реЗрджрдорд╛ рдХрд░реНрдо рдХрд╛рдгреНрдб рдорд╛рд░реНрдЧ (рд╢реНрд░рд╛рджреНрдз, рдкрд┐рдгреНрдб рджрд╛рди рдЧрд░реНрдиреБ рдЖрджрд┐) рд▓рд╛рдИ рдореВрд░реНрдЦрд╣рд░реБрдХреЛ рд╕рд╛рдзрдирд╛ рднрдирд┐рдПрдХреЛ рдЫ, рдЕрд░реНрдерд╛рдд рдпреЛ рдХреНрд░рд┐рдпрд╛ рд╡реНрдпрд░реНрде рддрдерд╛ рд╢рд╛рд╕реНрддреНрд░ рд╡рд┐рд░реБрджреНрдз рдЫред
